import React, { Component } from "react";

class NewPlayer extends Component {
	constructor(props) {
		super(props);
		this.state = {
			name: "",
		}
		this.onInput = this.onInput.bind(this);
	}

	onInput(e) {
		const name = e.target.value;

		this.setState({ name });
	}

	onSubmit(e) {
		e.preventDefault();
	}
}

export default NewPlayer;
